import styles from '../dashboard.module.scss';
import Navbar from '../../common/navbar/Navbar';
import { useEffect, useState } from 'react';
import axios from 'axios';
import { url } from '../../utils/constants';

function FarmManagement() {

    const [farms, setFarms] = useState([]);
    const [showEditPopup, setShowEditPopup] = useState(false);
    const [currentFarm, setCurrentFarm] = useState();

    const [model, setModel] = useState('');
    const [service, setService] = useState('');
    const [status, setStatus] = useState('');

    useEffect(() => {
        axios.get(`${url}/api/farm/`, {
            "Content-Type": "application/json",
        })
            .then(function (response) {
                console.log(response);
                setFarms(response.data.data);
            })
            .catch(function (error) {
                console.log(error);
            });
    }, [])

    console.log('drones', farms);

    const deleteFarm = (id) => {
        axios.delete(`${url}/api/farm/delete/${id}`, {
            "Content-Type": "application/json",
        })
            .then(function (response) {
                console.log(response);
                window.location.reload();
            })
            .catch(function (error) {
                console.log(error);
            });
    }

    const editFarm = (id) => {
        setShowEditPopup(true);
        const curFarm = farms.filter(function(farm) {
            return farm._id === id;
        })
        setCurrentFarm(curFarm)
        setModel(curFarm[0].model)
        setService(curFarm[0].service)
        setStatus(curFarm[0].status)
    }

    const editFarmRequest = () => {
        axios.put(`${url}/api/drone/edit/${currentFarm[0]._id}`,{
            model: model,
            service: service,
            status: status,
            zipcode: currentFarm[0].zipcode,
            country: currentFarm[0].country,
            farmerId: currentFarm[0].farmerId,
            pilotId: currentFarm[0].pilotId
        }, {
            "Content-Type": "application/json",
        })
            .then(function (response) {
                console.log(response);
                window.location.reload();
            })
            .catch(function (error) {
                console.log(error);
            });
    }

    console.log('currentDrone', currentFarm)

    return (
        <>
            <Navbar />
            <div className={styles['container']}>

                {
                    showEditPopup &&
                    <div className={styles['modal']}>
                        <div className={styles['modal-content']}>
                            <form>
                                <input type="text" value={model} onChange={(e) => setModel(e.target.value)} placeholder="Drone Model" />
                                <input type="text" value={service} onChange={(e) => setService(e.target.value)} placeholder="Service" />
                                <input type="text" value={status} onChange={(e) => setStatus(e.target.value)} placeholder="Status" />
                                <button onClick={editFarmRequest}>Submit</button>
                            </form>
                        </div>
                    </div>
                }

                <div className={styles['sidebar']}>
                    <div className={styles['title']}>
                        Dashboard
                    </div>
                    <div className={styles['options']}>
                        <div className={styles['option-select']}>
                            Farmers Management
                        </div>
                        <div className={styles['option']}>
                            Drone Management
                        </div>
                        <div className={styles['option']}>
                            Pilots Management
                        </div>
                        <div className={styles['option']}>
                            Farmlands Management
                        </div>
                        <div className={styles['option']}>
                            Farms Management
                        </div>
                    </div>
                </div>
                <div className={styles['body']}>
                    <div className={styles['info-container']}>
                        <div className={styles['header']}>
                            Farm Management
                        </div>
                    </div>

                    <div className={styles['table']}>
                        <div className={styles['title']}>
                            All Farms
                        </div>
                        <div className={styles['display']}>
                            <table>
                                <tr>
                                    <th>Farm ID#</th>
                                    <th>Name</th>
                                    <th>Address</th>
                                    <th>City</th>
                                    <th>ZipCode</th>
                                    <th>Delete</th>
                                    <th>Modify</th>
                                </tr>
                                {
                                    farms.map((farm, index) => {
                                        return (
                                            <tr key={farm._id}>
                                                <td>{farm._id}</td>
                                                <td>{farm.name}</td>
                                                <td>{farm.address}</td>
                                                <td>{farm.city}</td>
                                                <td>{farm.zipcode}</td>
                                                <td><button onClick={() => deleteFarm(farm._id)}>Delete</button></td>
                                                <td><button onClick={() => editFarm(farm._id)}>Edit</button></td>
                                            </tr>
                                        )
                                    })
                                }

                            </table>
                        </div>
                    </div>
                </div>
            </div>
        </>
    )
}

export default FarmManagement;
